    "Create discussions, share ideas and collaborate with your community directly in Nextcloud.\n\n**⚠️ Early Development Notice:**\nThis app is in early stages of development. While functional, you may encounter bugs or incomplete features. Please report any issues on GitHub and consider backing up your data regularly.\n\n**Key features:**\n- **Thread-based Discussions** - Create and reply to organized discussion threads\n- **Category Organization** - Structure your forum with customizable categories and headers\n- **Rich Text Formatting** - Use BBCode for formatting posts with bold, italic, links, images, code blocks and more\n- **File Attachments** - Attach files from your Nextcloud storage to posts\n- **Post Reactions** - React to posts with emoji reactions\n- **Read/Unread Tracking** - Keep track of which threads you've read\n- **Search** - Find discussions quickly with built-in search\n- **User Profiles** - View user post history and statistics\n- **Role-Based Permissions** - Control access and moderation with flexible roles\n- **Guest Access**: Optional public access for unauthenticated users with configurable permissions\n- **Admin Tools** - Manage categories, roles, BBCodes and forum settings\n- **Moderation Tools** - Pin, lock and manage threads and posts\n\n**Perfect for:**\n- Team discussions and collaboration\n- Community forums\n- Support channels\n- Knowledge bases\n- Project discussions\n- Internal communication\n\nThe forum integrates seamlessly with your Nextcloud instance, using your existing users and groups for authentication and access control." : "Nextcloud دا بىۋاسىتە جەمئىيىتىڭىز بىلەن مۇنازىرىلەرنى قۇرۇڭ، پىكىرلىرىڭىزنى ئورتاقلىشىڭ ۋە ھەمكارلىشىڭ.\n\n**⚠️ دەسلەپكى تەرەققىيات ئۇقتۇرۇشى:**\nبۇ ئەپ دەسلەپكى تەرەققىيات باسقۇچىدا. ئىقتىدارلىق بولسىمۇ، خاتالىقلارغا ياكى تولۇقسىز ئىقتىدارلارغا يولۇقۇشىڭىز مۇمكىن. GitHub دا ھەر قانداق مەسىلىنى دوكلات قىلىڭ ۋە سانلىق مەلۇماتلىرىڭىزنى دائىم زاپاسلاپ تۇرۇشنى ئويلىشىڭ.\n\n**ئاساسلىق ئالاھىدىلىكلەر:**\n- **تېما ئاساسلىق مۇنازىرىلەر** - تەشكىللەنگەن مۇھاكىمە تېمىلىرىنى قۇرۇش ۋە جاۋاب قايتۇرۇش\n- **كاتېگورىيە تەشكىللەش** - مۇنبىرىڭىزنى خاسلاشتۇرغىلى بولىدىغان تۈرلەر ۋە ماۋزۇلار بىلەن قۇرۇلمىلاشتۇرۇش\n- **باي تېكىست فورماتى** - قېلىن، يانتۇ، ئۇلىنىش، رەسىم، كود بۆلەكلىرى ۋە باشقا شەكىللەر بىلەن يازمىلارنى فورماتلاش ئۈچۈن BBCode نى ئىشلىتىش\n- **ھۆججەت قوشۇمچەلىرى** - Nextcloud ساقلىغۇچىڭىزدىكى ھۆججەتلەرنى يازمىلارغا قوشۇش\n- **يازمىلارغا ئىنكاس قايتۇرۇش** - يازمىلارغا emoji ئىنكاسلىرى بىلەن ئىنكاس قايتۇرۇش\n- **ئوقۇلغان/ئوقۇمىغانلارنى ئىز قوغلاش** - قايسى تېمىلارنى ئوقۇغانلىقىڭىزنى خاتىرىلەش\n- **ئىزدەش** - ئىچكى ئىزدەش ئارقىلىق مۇزاكىرىلەرنى تېز تېپىش\n- **ئىشلەتكۈچى ئارخىپى** - ئىشلەتكۈچىنىڭ يازما تارىخى ۋە ستاتىستىكىسىنى كۆرۈش\n- **رولغا ئاساسلانغان ئىجازەتلەر** - ئەركىن روللار بىلەن كىرىش ۋە باشقۇرۇشنى كونترول قىلىش\n- **مېھمان كىرىشى**: تەڭشىگىلى بولىدىغان ئىجازەتلەر بىلەن كىملىكى ئېنىق بولمىغان ئىشلەتكۈچىلەر ئۈچۈن ئىختىيارىي ئاممىۋى كىرىش\n- **باشقۇرۇش قوراللىرى** - تۈرلەر، روللار، BBCodes ۋە مۇنبەر تەڭشەكلىرىنى باشقۇرۇش\n- **باشقۇرۇش قوراللىرى** - تېمىلار ۋە يازمىلارنى مىخلاش، قۇلۇپلاش ۋە باشقۇرۇش\n\n**مۇكەممەل:**\n- گۇرۇپپا مۇنازىرىلىرى ۋە ھەمكارلىق\n- مەھەللە مۇنبىرى\n- قوللاش قاناللىرى\n- بىلىم ئاساسلىرى\n- تۈر مۇزاكىرىلىرى\n- ئىچكى ئالاقە\n\nمۇنبەر سىزنىڭ مەۋجۇت ئىشلەتكۈچىلىرىڭىز ۋە گۇرۇپپىلىرىڭىزنى ئىشلىتىپ، Nextcloud ئۈلگىڭىز بىلەن مۇكەممەل بىرلىشىدۇ، بۇ ئارقىلىق كىملىكنى جەزملەشتۈرۈش ۋە كىرىش كونترولى ئۈچۈن ئىشلىتىلىدۇ.",
